import React from 'react';
import buttons from './pictures/19010803 PALERMO DISTRESSED POLYESTER METAL RIM.jpg';
import './App.css';
import NavBar from './components/Navbar'
import 'bootstrap/dist/css/bootstrap.min.css'

function App() {
  return (
    <div className="App">
      <NavBar />
      <img src={buttons} alt='test' />
    </div>
  );
}

export default App;
